import React from "react";

const Searcher = (searcher) => {
  const sendInfo = (e) => {
    // const info = e.target.value;
    // searcher(info);
    console.log(e.target.value);
    searcher(e.target.value);
  };
  return (
    <>
      <input
        type="search"
        class="form-control mb-3"
        placeholder="Search"
        id="searcher"
        onChange={sendInfo}
      />
    </>
  );
};

export default Searcher;
